// Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import LogoutButton from './LogoutButton';
import './Navbar.css'; // Import Navbar styles

const Navbar = ({ loggedIn, onShowLoginForm, onShowSignupForm, onLogout }) => {
  return (
    <nav className="navbar">
      <ul className="navbar-nav">
        <li className="nav-item"><Link to="/">Home</Link></li>
        {!loggedIn && <li className="nav-item"><button className="login-button" onClick={onShowLoginForm}>Login</button></li>}
        {!loggedIn && <li className="nav-item"><button className="signup-button" onClick={onShowSignupForm}>Signup</button></li>}
        {loggedIn && <li className="nav-item"><LogoutButton setLoggedIn={onLogout} /></li>}
      </ul>
    </nav>
  );
};

export default Navbar;
